LongDescription:
120 James Street Townhouse 
- Available starting August 2025 (2025-2026 school year)
- Large townhouse - 1800sf (3 levels) and a great outdoor backyard patio
- Rent is $770 a person for a group of 4 students, you need to find housemates - we only rent out the entire house ;
- Many utilities/services included. You only need to pay NYSEG/electricity bill and wifi (average $40-50 per month per person);
- Perfect for Cornell University
